import React from 'react';
import { Text, View ,Pressable,StyleSheet} from 'react-native'; // Import from 'react-native'

function PrimaryButton({ children }) {
    const pressHanlder=()=>{console.log("pressed");}
  return (

    <View style={styles.btnOuterConatiner}>
         <Pressable onPress={pressHanlder}
         style={({pressed})=>pressed ? [styles.pressed,styles.Btncontainer]: styles.Btncontainer} android_ripple={{color:"#b5879e"}}>
      <Text style={styles.btnText}>{children}</Text>
      </Pressable>
    </View>

  );
}
const styles = StyleSheet.create({
    btnOuterConatiner:{
        borderRadius:8,
        margin:4,
        overflow:'hidden',
        width:"60%",

    },
    Btncontainer: {
      backgroundColor:'#72063c',
      paddingVertical:8,
      paddingHorizontal:16,

    },
    btnText:{
        color:"white",
        textAlign:"center",
    },
    pressed:{
opacity:0.75,
    }
  });
export default PrimaryButton;
